import "./BottomBar.css";
import { useNavigate } from "react";

const BottomBar = () => {
    const navigate = useNavigate();
    return (
        <div className="BOTTOM_BAR">
            <div className="BOTTOM_BAR_ICON FIRST_ICON"></div>
            <div className="BOTTOM_BAR_ICON SECOND_ICON"></div>
            <div className="BOTTOM_BAR_ICON THIRD_ICON"></div>
        </div>
    );
};

export default BottomBar;
